import React from "react";

const Login = () => {
  return (
    <div>
      <div></div>
      <div>
        <h2>Login</h2>
      </div>
        <div><h5>Please Enter </h5></div>
      <div>
        <input type="text" />
      </div>
      <div>
        <input type="password" placeholder="Enter your password" />
      </div>
    </div>
  );
};

export default Login;
